INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 24015, 4, 10021, "カオリ（サマー）", 0.0, 0.0, 1, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 1, 24016, 4, 10021, "カオリ（サマー）", 0.0, 4.0, 2, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 24017, 4, 10021, "カオリ（サマー）", 0.0, 0.0, 3, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 2, 24018, 1, 10021, "カオリ（サマー）", 0.0, 5.2, 4, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 6, 24019, 5, 10021, "カオリ（サマー）", 0.0, 4.2, 5, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 24020, 2, 10021, "カオリ（サマー）", 0.0, 0.0, 6, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6, 24021, 1, 10021, "カオリ（サマー）", 0.0, 6.4, 7, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 24022, 2, 10021, "カオリ（サマー）", 0.0, 0.0, 8, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 3, 24023, 6, 10021, "カオリ（サマー）", 0.0, 10.08, 9, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 2, 24024, 1, 10021, "カオリ（サマー）", 0.0, 5.0, 10, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", 24, 110501, "2019/07/31 12:00:00", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 24025, 2, 10021, "カオリ（サマー）", 0.0, 0.0, 11, 0.0);
